INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (34,'2024-09-24 13:59:11',55,29,432.99,4,'asdf','Vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum.','Intellegunt totam rationem everti, si ita res.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (35,'2024-02-08 14:10:46',39,15,605.61,4,'asdf','Locus huic disputationi vel maxime necessarius de amicitia, quam, si voluptas summum sit bonum, affirmatis nullam omnino fore. De qua omne certamen est? Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit.','Et quaerendi defatigatio turpis est, cum esset accusata et vituperata ab Hortensio. Qui liber cum et mortem contemnit, qua qui est imbutus quietus esse numquam potest. Praeterea.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (36,'2023-12-16 20:49:04',58,30,609.98,4,'asdf','De quo quaerimus, non quo ignorare vos.','Nos abducat? Sin laboramus, quis est, qui alienae modum statuat industriae? Nam ut Terentianus Chremes non inhumanus, qui novum vicinum non vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum ab industria, sed ab inliberali labore deterret --, sic isti curiosi, quos offendit noster minime nobis iniucundus labor. Iis igitur est difficilius satis.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (37,'2024-01-07 15:10:27',43,27,573.12,2,'Excepteur sint occaecat cupidatat non proident, sunt in culpa qui.','Quem quidem locum comit multa venustate et omni sale idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis, id quod maluisti, te, cum.','Atilii mihi legendam putem, de quo Lucilius.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (38,'2024-04-21 08:36:34',47,12,603.89,2,'asdf','Voluptate discedere. Nam cum solitudo et vita sine amicis insidiarum et metus plena sit, ratio ipsa monet amicitias.','Vituperandae, maledicta, contumeliae, tum iracundiae, contentiones concertationesque in disputando pertinaces indignae philosophia mihi videri solent. Tum Torquatus: Prorsus, inquit, assentior; neque enim tempus est ullum, quo non plus voluptatum habeat quam dolorum. Nam et ipsa declinatio.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (39,'2023-12-12 11:59:08',42,9,586.85,2,'Successerit, at contra gaudere nosmet omittendis doloribus.','Levis, in gravitate brevis soleat esse, ut eius magnitudinem celeritas, diuturnitatem allevatio consoletur. Ad ea cum accedit, ut neque divinum numen horreat nec praeteritas voluptates effluere patiatur earumque assidua recordatione laetetur, quid est, quod huc possit, quod melius sit.','Et ab Epicuro reprehensa et.',0,1);
